  false,\n\t\"url\": null,\n\t\"notes\": \"An inventory of endangered species and
  the wildlife resources at the US Army Kwajelein Atoll, Republic of the Marshall
  Island were conducted from 30 October 1998 to 14 December 1998. Inventories include
  overall bird species observed, distribution and status of seabird species of concern,
  distribution and status of waterfowl, land bird, and shorebird species of concern,
  numbers of seabird species of concern, numbers of waterfowl, land bird, and shorebird
  species of concern, number of Pacific Reef Heron color morphs, plant species observed,
  coral species of concern observed, sponge species of concern observed, and mollusk
  species of concern observed.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
